import React from 'react';

export default function Select(arrValue, arrName){
    return(
        <select>
            {
                arrValue.map((value,indice)=>{
                    return(
                        <option value={value}>${arrName[indice]}</option>
                    )
                })
            }
        </select>
    )
}
